import React from 'react';
import { Divider, Toolbar, Typography, Box, Grid, Paper, Link } from '@mui/material';
import { styled } from '@mui/system';

// Feature Box Styling - White background, black text
const FeatureBox = styled(Paper)(({ theme }) => ({
  borderRadius: '10px',
  boxShadow: '0 8px 16px rgba(0, 0, 0, 0.1)', // Softer shadow for white background
  padding: theme.spacing(4),
  textAlign: 'center',
  backgroundColor: '#ffffff', // Solid white background
  border: '1px solid #e0e0e0', // Optional: light border for definition
  transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  '&:hover': {
    transform: 'translateY(-10px)',
    boxShadow: '0 12px 24px rgba(0, 0, 0, 0.15)', // Slightly stronger shadow on hover
  },
  // Ensure text inside is black (or default MUI text color)
  color: theme.palette.text.primary, // Use theme's primary text color (usually black/dark grey)
}));

// Footer Section Styling - Black background, white text
const Footer = styled(Box)(({ theme }) => ({
  backgroundColor: '#000000', // Solid black background for footer
  color: '#ffffff', // White text
  padding: theme.spacing(4, 2),
  marginTop: theme.spacing(6),
  borderRadius: '10px', // Keep rounded corners if desired
  boxShadow: '0 8px 16px rgba(0, 0, 0, 0.3)',
  textAlign: 'center',
  fontFamily: '"Roboto", sans-serif',
  display: 'flex',
  justifyContent: 'center',
  flexDirection: 'row',
  alignItems: 'flex-start',
}));

// Footer Column Styling - No color changes needed, inherits from Footer
const FooterColumn = styled(Grid)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'flex-start',
  justifyContent: 'center',
  textAlign: 'left',
  flex: 1,
  paddingLeft: theme.spacing(3),
  paddingRight: theme.spacing(3),
}));

// Link Styling in Footer - White links, grey on hover
const FooterLink = styled(Link)(({ theme }) => ({
  color: '#ffffff', // White link text
  textDecoration: 'none',
  '&:hover': {
    color: '#cccccc', // Light grey on hover
    textDecoration: 'underline',
  },
}));

export default function Home() {
  return (
    <>
      {/* Toolbar - White background */}
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: 'auto',
          textAlign: 'center',
          backgroundColor: '#ffffff', // White background for the header area
          paddingTop: 2,
          // Optional: add bottom border if needed for separation
          // borderBottom: '1px solid #e0e0e0'
        }}
      >
        <Typography
          variant='h4'
          sx={{
            fontWeight: 'bold',
            color: '#000000', // Black text
            textTransform: 'uppercase',
            letterSpacing: 2,
          }}
        >
          Features of MEEWOO BANK
        </Typography>
      </Box>
      {/* Divider - Use default theme divider (usually light grey) or specify black */}
      <Divider sx={{ backgroundColor: '#e0e0e0', marginY: 1 }}/>

      {/* Centered Container for Features - White background */}
      <Box
        sx={{
          padding: 4,
          display: 'flex',
          justifyContent: 'center',
          marginTop: 4,
          boxShadow: '0 8px 16px rgba(0, 0, 0, 0.1)', // Adjusted shadow
          borderRadius: '10px',
          backgroundColor: '#ffffff', // Explicitly white background
        }}
      >
        <Grid container spacing={3} justifyContent="center">
          <Grid item xs={12} sm={4}>
            <FeatureBox>
              {/* Text color defaults to black from FeatureBox style */}
              <Typography variant="h6" sx={{ color: '#000000' }}>Easy Transactions</Typography>
              <Typography variant="body2" sx={{ color: '#333333' }}>Make seamless transfers and manage your bank accounts with ease.</Typography>
            </FeatureBox>
          </Grid>
          <Grid item xs={12} sm={4}>
            <FeatureBox>
              <Typography variant="h6" sx={{ color: '#000000' }}>24/7 Support</Typography>
              <Typography variant="body2" sx={{ color: '#333333' }}>Our customer support team is available around the clock to assist you.</Typography>
            </FeatureBox>
          </Grid>
          <Grid item xs={12} sm={4}>
            <FeatureBox>
              <Typography variant="h6" sx={{ color: '#000000' }}>Secure Banking</Typography>
              <Typography variant="body2" sx={{ color: '#333333' }}>Your account security is our priority, with top-notch encryption.</Typography>
            </FeatureBox>
          </Grid>
        </Grid>
      </Box>

      {/* Footer Section - Black background, white text */}
      <Footer>
        <Grid container spacing={4} justifyContent="center">
          {/* About Section */}
          <FooterColumn item xs={12} sm={6}>
            <Typography variant="h6" style={{ fontWeight: 'bold', marginBottom: 16 }}>
              About
            </Typography>
            <Typography variant="body2" style={{ marginBottom: 8 }}>
              We are a customer-centric bank focused on providing innovative financial solutions.
              Our mission is to deliver exceptional service and help our customers reach their financial goals.
            </Typography>
            <FooterLink href="#">Learn More</FooterLink> {/* Changed href to # as example */}
          </FooterColumn>

          {/* Contact Section */}
          <FooterColumn item xs={12} sm={6}>
            <Typography variant="h6" style={{ fontWeight: 'bold', marginBottom: 16 }}>
              Contact
            </Typography>
            <Typography variant="body2" style={{ marginBottom: 8 }}>
              <strong>Email:</strong> <FooterLink href="mailto:support@mybank.com">support@mybank.com</FooterLink>
            </Typography>
            <Typography variant="body2" style={{ marginBottom: 8 }}>
              <strong>Phone:</strong> <FooterLink href="tel:+123456789">+123 456 789</FooterLink>
            </Typography>
          </FooterColumn>
        </Grid>
      </Footer>

      {/* Divider and All Rights Reserved - Black text on default (likely white) page background */}
      <Divider sx={{ margin: '20px 0', backgroundColor: '#cccccc' }} /> {/* Lighter divider */}
      <Box sx={{ textAlign: 'center', fontWeight:'bold', color: 'black', paddingBottom: 2 }}>
        <Typography variant="body2" sx={{ fontSize: '0.875rem' }}>
          © 2025 My Bank. All Rights Reserved.
        </Typography>
      </Box>
    </>
  )
}
